// captcha image download
// changeCaptch function click 시 a tag에 href download atrribute 만들어서 넣고
// axios로 보내고 response 받아서 바로 저장 후
// html element로 만들어 화면에 보여주기

// DOM 에서 axios 사용하게 <script 추가
var script = document.createElement( 'script' );
script.type = 'text/javascript';
script.src = "https://cdnjs.cloudflare.com/ajax/libs/axios/0.19.0/axios.min.js";
$('head').append(script);

(function changeCaptcha2() {
    axios({
        url: '/captcha/CaptChaImg.jsp?rand='+ Math.random(),
        method: 'GET',
        responseType: 'blob'
      }).then((response) => {
        console.log("🚀 ~ file: PayInfo_DOM.js ~ line 195 ~ changeCaptcha ~ response.data", response.data)
        const url = window.URL.createObjectURL(new Blob([response.data]))
        const link = document.createElement('a')
        link.href = url
        link.setAttribute('download', 'captchaImg.png')
        document.body.appendChild(link)
        link.click()
      })
    
})()


